import React, { useState } from "react";
import './Sidebar.css';
import Accordion from "./Accordion";

function Sidebar({ page }) {
    const [collapsed, setCollapsed] = useState(false);

    const getItems = () => {
        if (page === "math/aa") {
            return sidebars[0];
        } else if (page === "math/ai") {
            return sidebars[1];
        } else {
            return [
                {title: "Default Chapter", content:"This is the default content."}
            ];
        }
    };

    return (
        <div className={`sidebar-container ${collapsed ? "collapsed" : ""}`}>
            <div className={`sidebar`}>
                <div className="sidebar-content">
                    <div className="p-4">
                        <h1>Analysis & Approaches</h1>
                        <h2>Units</h2>
                    </div>
                    <Accordion items={getItems()}/>
                </div>
            </div>
            <button
                className={`sidebar-toggle ${collapsed ? "collapsed" : ""}`}
                onClick={() => setCollapsed(!collapsed)}
            >
            </button>
        </div>
    );
}

export default Sidebar;

// In Sidebar.js (or wherever your sidebar data is defined)
const sidebars = [
    [ // AA [0]
        {
            title: "Chapter 1: Number and Algebra",
            content: (
            <div className="flex flex-col gap-2">
                <b>Year 1</b>
                <a href="subjects/math/1-1"><b>1.1:</b> Numbers – rounding – scientific form</a>
                <a href="subjects/math/1-2"><b>1.2:</b> Sequences in general - Series</a>
                <a href="subjects/math/1-3"><b>1.3:</b> Arithmetic sequences</a>
                <a href="subjects/math/1-4"><b>1.4:</b> Geometric sequences</a>
                <a href="subjects/math/1-5"><b>1.5:</b> Applications of G.S. – Percentage growth</a>
                <a href="subjects/math/1-6"><b>1.6:</b> The Binomial Theorem – <i>(a+b)<sup>n</sup></i></a>
                <a href="subjects/math/1-7"><b>1.7:</b> Deductive proof</a>
                <a href="subjects/math/1-8"><b>1.8:</b> Methods of proof</a>
                <a href="subjects/math/1-9"><b>1.9:</b> Mathematical induction</a>
                <b>Year 2</b>
                <a href="subjects/math/1-10"><b>1.10:</b> Systems of linear equations</a>
                <a href="subjects/math/1-11"><b>1.11:</b> Complex numbers – basic operations</a>
                <a href="subjects/math/1-12"><b>1.12:</b> Polynomials over the Complex field</a>
                <a href="subjects/math/1-13"><b>1.13:</b> The complex plane</a>
                <a href="subjects/math/1-14"><b>1.14:</b> De Moivre’s theorem</a>
                <a href="subjects/math/1-15"><b>1.15:</b> Roots of <i>z<sup>n</sup>=a</i></a>
            </div>
            )
        },
        {
            title: "Chapter 2: Functions",
            content: (
            <div className="flex flex-col gap-2">
                <a href="subjects/math/2-1"><b>2.1:</b> Lines (or Linear functions)</a>
                <a href="subjects/math/2-2"><b>2.2:</b> Quadratics (or Quadratic functions)</a>
                <a href="subjects/math/2-3"><b>2.3:</b> Functions, domain, range, graph</a>
                <a href="subjects/math/2-4"><b>2.4:</b> Composition of functions: <i>f o g</i></a>
                <a href="subjects/math/2-5"><b>2.5:</b> The inverse function: <i>f<sup>-1</sup></i></a>
                <a href="subjects/math/2-6"><b>2.6:</b> Transformations of functions</a>
                <a href="subjects/math/2-7"><b>2.7:</b> Asymptotes</a>
